import React from "react";
import "./SideBar.css";

function SideBar({ repos, onRepoSelect }) {
    return (
        <div className="sidebar">
            <h2>Your Repositories</h2>
            <ul>
                {repos.map((repo, index) => (
                    <li key={index} onClick={() => onRepoSelect(repo)}>
                        {repo}
                    </li>
                ))}
            </ul>
            <button className="clone-repo-btn" onClick={() => onRepoSelect(null)}>
                Clone Repo
            </button>
        </div>
    );
}

export default SideBar;
